def par(arr):
    a = [int(x) for x in arr.split()]
    n = len(a)
    a0 = a[0]
    ops = 0
    # TODO: resolve quadratic running time!
    while True:
        for i in range(1, n):
            ops += 1
            if a[i] >= a0:
                l = i
                break
        for j in range(n - 1, l, -1):
            ops += 1
            if a[j] < a0:
                r = j
                break
        if l < r:
            print(ops)
            a[i], a[j] = a[j], a[i]
        else:
            # Swap pivot
            a[0], a[j] = a[j], a[0]
            break
    print(" ".join(str(x) for x in a))


